import React from "react";
import FormControl from "@material-ui/core/FormControl";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import Question from "./Question";
export default function RadioButtons({ data, setValues, summary, setSummary }) {
  function getPoint(id) {
    var point;
    point = id + 1.0;
    return point;
  }
  function X1() {
    var sum, x;
    sum =
      getPoint(data[0].value) +
      getPoint(data[1].value) +
      getPoint(data[2].value) +
      getPoint(data[3].value) +
      getPoint(data[4].value) +
      getPoint(data[5].value) +
      getPoint(data[6].value);
    x = sum / 7;

    return x;
  }

  function X2() {
    var sum, x;
    sum =
      getPoint(data[7].value) +
      getPoint(data[8].value) +
      getPoint(data[9].value) +
      getPoint(data[10].value) +
      getPoint(data[11].value) +
      getPoint(data[12].value);
    x = sum / 6;

    return x;
  }
  function X3() {
    var sum, x;
    sum =
      getPoint(data[13].value) +
      getPoint(data[14].value) +
      getPoint(data[15].value) +
      getPoint(data[16].value) +
      getPoint(data[17].value) +
      getPoint(data[18].value) +
      getPoint(data[19].value);
    x = sum / 7;

    return x;
  }
  function X4() {
    var sum, x;
    sum =
      getPoint(data[20].value) +
      getPoint(data[21].value) +
      getPoint(data[22].value) +
      getPoint(data[23].value) +
      getPoint(data[24].value);

    x = sum / 5;

    return x;
  }
  function X5() {
    var sum, x;
    sum =
      getPoint(data[25].value) +
      getPoint(data[26].value) +
      getPoint(data[27].value) +
      getPoint(data[28].value) +
      getPoint(data[29].value);

    x = sum / 5;

    return x;
  }
  function X6() {
    var sum, x;
    sum =
      getPoint(data[30].value) +
      getPoint(data[31].value) +
      getPoint(data[32].value) +
      getPoint(data[33].value);

    x = sum / 4;

    return x;
  }
  function X7() {
    var sum, x;
    sum =
      getPoint(data[34].value) +
      getPoint(data[35].value) +
      getPoint(data[36].value);
    x = sum / 3;

    return x;
  }
  function X8() {
    var sum, x;
    sum = getPoint(data[37].value) + getPoint(data[38].value);

    x = sum / 2;

    return x;
  }
  function X9() {
    var sum, x;
    sum = getPoint(data[39].value) + getPoint(data[40].value);
    x = sum / 2;

    return x;
  }
  function X() {
    var i, sum, x;
    for (i = 0, sum = 0; i < 41; i++) sum += getPoint(data[i].value);
    x = sum / 41;

    return x;
  }
  function getSD1() {
    var sum, pow, sqr;
    sum = X1() * 7 - X() * 7;
    pow = Math.pow(sum, 2) / 7;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD2() {
    var sum, pow, sqr;
    sum = sum = X2() * 6 - X() * 6;
    pow = Math.pow(sum, 2) / 6;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD3() {
    var sum, pow, sqr;
    sum = X3() * 7 - X() * 7;
    pow = Math.pow(sum, 2) / 7;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD4() {
    var sum, pow, sqr;
    sum = X4() * 5 - X() * 5;
    pow = Math.pow(sum, 2) / 5;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD5() {
    var sum, pow, sqr;
    sum = X5() * 5 - X() * 5;
    pow = Math.pow(sum, 2) / 5;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD6() {
    var sum, pow, sqr;
    sum = X6() * 4 - X() * 4;
    pow = Math.pow(sum, 2) / 4;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD7() {
    var sum, pow, sqr;
    sum = X7() * 3 - X() * 3;
    pow = Math.pow(sum, 2) / 3;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD8() {
    var sum, pow, sqr;
    sum = X8() * 2 - X() * 2;
    pow = Math.pow(sum, 2) / 2;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  function getSD9() {
    var sum, pow, sqr;
    sum = X9() * 2 - X() * 2;
    pow = Math.pow(sum, 2) / 2;
    sqr = Math.sqrt(pow);
    return sqr;
  }
  // d0
  function d0_1() {
    var d0;
    d0 = (X1() - X()) / getSD1();
    return d0;
  }
  function d0_2() {
    var d0;
    d0 = (X2() - X()) / getSD2();
    return d0;
  }
  function d0_3() {
    var d0;
    d0 = (X3() - X()) / getSD3();
    return d0;
  }
  function d0_4() {
    var d0;
    d0 = (X4() - X()) / getSD4();
    return d0;
  }
  function d0_5() {
    var d0;
    d0 = (X1() - X()) / getSD5();
    return d0;
  }
  function d0_6() {
    var d0;
    d0 = (X6() - X()) / getSD6();
    return d0;
  }
  function d0_7() {
    var d0;
    d0 = (X7() - X()) / getSD7();
    return d0;
  }
  function d0_8() {
    var d0;
    d0 = (X8() - X()) / getSD8();
    return d0;
  }
  function d0_9() {
    var d0;
    d0 = (X9() - X()) / getSD9();
    return d0;
  }
  //get sum d^2
  function d1() {
    var d, result;

    d =
      Math.pow(d0_1() + 0.96, 2) +
      Math.pow(d0_2() + 0.6, 2) +
      Math.pow(d0_3() + 1.4, 2) +
      Math.pow(d0_4() - 0.47, 2) +
      Math.pow(d0_5() + 0.41, 2) +
      Math.pow(d0_6() + 0.01, 2) +
      Math.pow(d0_7() + 0.21, 2) +
      Math.pow(d0_8() + 0.37, 2) +
      Math.pow(d0_9() + 0.33, 2);
    result = d / 9;
    return result;
  }
  function d2() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.47, 2) +
      Math.pow(d0_2() - 0.46, 2) +
      Math.pow(d0_3() - 0.56, 2) +
      Math.pow(d0_4() - 0.28, 2) +
      Math.pow(d0_5() - 0.16, 2) +
      Math.pow(d0_6() - 0.58, 2) +
      Math.pow(d0_7() - 0.13, 2) +
      Math.pow(d0_8() - 0.19, 2) +
      Math.pow(d0_9() + 0.04, 2);
    result = d / 9;
    return result;
  }
  function d3() {
    var d, result;
    d =
      Math.pow(d0_1() - 1.38, 2) +
      Math.pow(d0_2() + 0.95, 2) +
      Math.pow(d0_3() - 1.54, 2) +
      Math.pow(d0_4() - 0.51, 2) +
      Math.pow(d0_5() - 0.46, 2) +
      Math.pow(d0_6() - 0.01, 2) +
      Math.pow(d0_7() + 0.26, 2) +
      Math.pow(d0_8() + 0.16, 2) +
      Math.pow(d0_9() - 0.1, 2);
    result = d / 9;
    return result;
  }
  function d4() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.74, 2) +
      Math.pow(d0_2() + 0.04, 2) +
      Math.pow(d0_3() - 0.02, 2) +
      Math.pow(d0_4() - 0.11, 2) +
      Math.pow(d0_5() - 0.04, 2) +
      Math.pow(d0_6() - 0.07, 2) +
      Math.pow(d0_7() - 0.09, 2) +
      Math.pow(d0_8() + 0.39, 2) +
      Math.pow(d0_9() - 0.04, 2);
    result = d / 9;
    return result;
  }
  function d5() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.03, 2) +
      Math.pow(d0_2() + 0.49, 2) +
      Math.pow(d0_3() + 0.77, 2) +
      Math.pow(d0_4() + 1.02, 2) +
      Math.pow(d0_5() + 0.61, 2) +
      Math.pow(d0_6() + 1.06, 2) +
      Math.pow(d0_7() + 0.57, 2) +
      Math.pow(d0_8() + 0.09, 2) +
      Math.pow(d0_9() + 0.68, 2);
    result = d / 9;
    return result;
  }
  function d6() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.03, 2) +
      Math.pow(d0_2() + 0.81, 2) +
      Math.pow(d0_3() - 0.93, 2) +
      Math.pow(d0_4() + 0.52, 2) +
      Math.pow(d0_5() + 0.65, 2) +
      Math.pow(d0_6() + 0.93, 2) +
      Math.pow(d0_7() + 0.89, 2) +
      Math.pow(d0_8() + 0.56, 2) +
      Math.pow(d0_9() + 0.84, 2);
    result = d / 9;
    return result;
  }
  function d7() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.54, 2) +
      Math.pow(d0_2() - 0.15, 2) +
      Math.pow(d0_3() + 0.09, 2) +
      Math.pow(d0_4() + 0.76, 2) +
      Math.pow(d0_5() + 0.73, 2) +
      Math.pow(d0_6() + 1.02, 2) +
      Math.pow(d0_7() + 0.84, 2) +
      Math.pow(d0_8() + 1.28, 2) +
      Math.pow(d0_9() + 1.01, 2);
    result = d / 9;
    return result;
  }
  function d8() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.54, 2) +
      Math.pow(d0_2() + 0.39, 2) +
      Math.pow(d0_3() - 1.01, 2) +
      Math.pow(d0_4() - 0.4, 2) +
      Math.pow(d0_5() - 0.35, 2) +
      Math.pow(d0_6() - 1.14, 2) +
      Math.pow(d0_7() - 0.3, 2) +
      Math.pow(d0_8() - 0.53, 2) +
      Math.pow(d0_9() - 0.67, 2);
    result = d / 9;
    return result;
  }
  function d9() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.81, 2) +
      Math.pow(d0_2() + 1.77, 2) +
      Math.pow(d0_3() + 2.2, 2) +
      Math.pow(d0_4() + 1.93, 2) +
      Math.pow(d0_5() + 1.64, 2) +
      Math.pow(d0_6() + 2.1, 2) +
      Math.pow(d0_7() + 1.23, 2) +
      Math.pow(d0_8() + 0.92, 2) +
      Math.pow(d0_9() + 1.67, 2);
    result = d / 9;
    return result;
  }
  function d10() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.69, 2) +
      Math.pow(d0_2() - 1.12, 2) +
      Math.pow(d0_3() + 0.13, 2) +
      Math.pow(d0_4() + 0.25, 2) +
      Math.pow(d0_5() + 0.11, 2) +
      Math.pow(d0_6() - 0.32, 2) +
      Math.pow(d0_7() + 0.6, 2) +
      Math.pow(d0_8() + 0.05, 2) +
      Math.pow(d0_9() - 0.03, 2);
    result = d / 9;
    return result;
  }
  function d11() {
    var d, result;
    d =
      Math.pow(d0_1() + 1.11, 2) +
      Math.pow(d0_2() + 0.8, 2) +
      Math.pow(d0_3() + 0.28, 2) +
      Math.pow(d0_4() - 1.24, 2) +
      Math.pow(d0_5() - 0.0, 2) +
      Math.pow(d0_6() - 0.63, 2) +
      Math.pow(d0_7() - 0.36, 2) +
      Math.pow(d0_8() + 0.23, 2) +
      Math.pow(d0_9() + 0.4, 2);
    result = d / 9;
    return result;
  }
  function d12() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.67, 2) +
      Math.pow(d0_2() + 0.3, 2) +
      Math.pow(d0_3() - 0.12, 2) +
      Math.pow(d0_4() - 0.74, 2) +
      Math.pow(d0_5() - 0.06, 2) +
      Math.pow(d0_6() - 0.21, 2) +
      Math.pow(d0_7() - 0.13, 2) +
      Math.pow(d0_8() + 0.14, 2) +
      Math.pow(d0_9() - 0.26, 2);
    result = d / 9;
    return result;
  }
  function d13() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.86, 2) +
      Math.pow(d0_2() + 0.43, 2) +
      Math.pow(d0_3() - 1.2, 2) +
      Math.pow(d0_4() - 1.86, 2) +
      Math.pow(d0_5() - 0.7, 2) +
      Math.pow(d0_6() - 1.88, 2) +
      Math.pow(d0_7() - 1.28, 2) +
      Math.pow(d0_8() - 0.35, 2) +
      Math.pow(d0_9() - 0.66, 2);
    result = d / 9;
    return result;
  }
  function d14() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.48, 2) +
      Math.pow(d0_2() - 0.43, 2) +
      Math.pow(d0_3() + 0.19, 2) +
      Math.pow(d0_4() - 0.51, 2) +
      Math.pow(d0_5() + 0.18, 2) +
      Math.pow(d0_6() - 0.3, 2) +
      Math.pow(d0_7() + 0.09, 2) +
      Math.pow(d0_8() - 0.83, 2) +
      Math.pow(d0_9() - 0.64, 2);
    result = d / 9;
    return result;
  }
  function d15() {
    var d, result;
    d =
      Math.pow(d0_1() - 0.42, 2) +
      Math.pow(d0_2() - 0.04, 2) +
      Math.pow(d0_3() + 0.09, 2) +
      Math.pow(d0_4() - 1.03, 2) +
      Math.pow(d0_5() - 0.24, 2) +
      Math.pow(d0_6() - 1.24, 2) +
      Math.pow(d0_7() - 0.29, 2) +
      Math.pow(d0_8() - 0.06, 2) +
      Math.pow(d0_9() + 0.1, 2);
    result = d / 9;
    return result;
  }
  function d16() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.36, 2) +
      Math.pow(d0_2() + 0.03, 2) +
      Math.pow(d0_3() + 1.25, 2) +
      Math.pow(d0_4() - 0.26, 2) +
      Math.pow(d0_5() - 0.46, 2) +
      Math.pow(d0_6() + 0.38, 2) +
      Math.pow(d0_7() + 0.95, 2) +
      Math.pow(d0_8() + 0.94, 2) +
      Math.pow(d0_9() + 0.36, 2);
    result = d / 9;
    return result;
  }
  function d17() {
    var d, result;
    d =
      Math.pow(d0_1() - 2.96, 2) +
      Math.pow(d0_2() - 2.96, 2) +
      Math.pow(d0_3() - 0.66, 2) +
      Math.pow(d0_4() + 1.9, 2) +
      Math.pow(d0_5() - 3.36, 2) +
      Math.pow(d0_6() + 1.36, 2) +
      Math.pow(d0_7() - 3.21, 2) +
      Math.pow(d0_8() - 3.42, 2) +
      Math.pow(d0_9() - 3.2, 2);
    result = d / 9;
    return result;
  }
  function d18() {
    var d, result;
    d =
      Math.pow(d0_1() + 0.87, 2) +
      Math.pow(d0_2() + 0.45, 2) +
      Math.pow(d0_3() + 1.19, 2) +
      Math.pow(d0_4() - 0.21, 2) +
      Math.pow(d0_5() + 0.58, 2) +
      Math.pow(d0_6() - 0.5, 2) +
      Math.pow(d0_7() + 0.16, 2) +
      Math.pow(d0_8() + 0.27, 2) +
      Math.pow(d0_9() + 0.17, 2);
    result = d / 9;
    return result;
  }
  function getD0() {
    var d0 =
      Math.pow(d1(), 2) +
      Math.pow(d2(), 2) +
      Math.pow(d3(), 2) +
      Math.pow(d4(), 2) +
      Math.pow(d5(), 2) +
      Math.pow(d6(), 2) +
      Math.pow(d7(), 2) +
      Math.pow(d8(), 2) +
      Math.pow(d9(), 2);
    var di = d0 / 9;
    return di;
  }
  function getRp1() {
    var result = (8.343 + getD0() - d1()) / (8.343 + getD0() + d1());
    return result;
  }
  function getRp2() {
    var result = (8.343 + getD0() - d2()) / (8.343 + getD0() + d2());
    return result;
  }
  function getRp3() {
    var result = (8.343 + getD0() - d3()) / (8.343 + getD0() + d3());
    return result;
  }
  function getRp4() {
    var result = (8.343 + getD0() - d4()) / (8.343 + getD0() + d4());
    return result;
  }
  function getRp5() {
    var result = (8.343 + getD0() - d5()) / (8.343 + getD0() + d5());
    return result;
  }
  function getRp6() {
    var result = (8.343 + getD0() - d6()) / (8.343 + getD0() + d6());
    return result;
  }
  function getRp7() {
    var result = (8.343 + getD0() - d7()) / (8.343 + getD0() + d7());
    return result;
  }
  function getRp8() {
    var result = (8.343 + getD0() - d8()) / (8.343 + getD0() + d8());
    return result;
  }
  function getRp9() {
    var result = (8.343 + getD0() - d9()) / (8.343 + getD0() + d9());
    return result;
  }
  function getRp10() {
    var result = (8.343 + getD0() - d10()) / (8.343 + getD0() + d10());
    return result;
  }
  function getRp11() {
    var result = (8.343 + getD0() - d11()) / (8.343 + getD0() + d11());
    return result;
  }
  function getRp12() {
    var result = (8.343 + getD0() - d12()) / (8.343 + getD0() + d12());
    return result;
  }
  function getRp13() {
    var result = (8.343 + getD0() - d13()) / (8.343 + getD0() + d13());
    return result;
  }
  function getRp14() {
    var result = (8.343 + getD0() - d14()) / (8.343 + getD0() + d14());
    return result;
  }
  function getRp15() {
    var result = (8.343 + getD0() - d15()) / (8.343 + getD0() + d15());
    return result;
  }
  function getRp16() {
    var result = (8.343 + getD0() - d16()) / (8.343 + getD0() + d16());
    return result;
  }
  function getRp17() {
    var result = (8.343 + getD0() - d17()) / (8.343 + getD0() + d17());
    return result;
  }
  function getRp18() {
    var result = (8.343 + getD0() - d18()) / (8.343 + getD0() + d18());
    return result;
  }

  const handleChange = (value, index) => {
    const newArray = [...data];
    const newSummary = [...summary];
    newArray[index].value = value;
    newSummary[0].activity = getRp1().toFixed(2);
    newSummary[1].activity = getRp2().toFixed(2);
    newSummary[2].activity = getRp3().toFixed(2);
    newSummary[3].activity = getRp4().toFixed(2);
    newSummary[4].activity = getRp5().toFixed(2);
    newSummary[5].activity = getRp6().toFixed(2);
    newSummary[6].activity = getRp7().toFixed(2);
    newSummary[7].activity = getRp8().toFixed(2);
    newSummary[8].activity = getRp9().toFixed(2);
    newSummary[9].activity = getRp10().toFixed(2);
    newSummary[10].activity = getRp11().toFixed(2);
    newSummary[11].activity = getRp12().toFixed(2);
    newSummary[12].activity = getRp13().toFixed(2);
    newSummary[13].activity = getRp14().toFixed(2);
    newSummary[14].activity = getRp15().toFixed(2);
    newSummary[15].activity = getRp16().toFixed(2);
    newSummary[16].activity = getRp17().toFixed(2);
    newSummary[17].activity = getRp18().toFixed(2);
    console.log("getRP1", getRp1());
    console.log("new", newSummary);
    setSummary(newSummary);
    setValues(newArray);
  };

  const renderQuestions = () => {
    return data.map((question, index) => {
      return (
        <Grid container xs={12} key={index}>
          <Question
            index={index}
            value={question.value}
            header={question.header}
            description={question.description}
            sub1={question.sub1}
            sub2={question.sub2}
            handleChange={(e) => handleChange(e, index)}
          />
        </Grid>
      );
    });
  };

  //
  return (
    <div>
      <Box bgcolor="background.paper" spacing={10}>
        <FormControl component="fieldset">{renderQuestions()}</FormControl>
      </Box>
    </div>
  );
}
